import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.scss'; 

const Navbar = () => {
  return (
    <nav className="navbar">
        <img src={logo} alt="MoodApp Logo" className="navbar-logo" />
      <div className="navbar-links">
        <Link to="/" className="navbar-link">Your mood</Link>
        <Link to="/about" className="navbar-link">Links</Link>
      </div>
    </nav>
  );
};

export default Navbar;
